  \"2016-07-27T23:06:10.205308\",\n\t\"name\": \"julia-butler-hansen-nwr-initial-survey-instructions-for-resident-dark-goose-rdg-mark-resig\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"JBH supports thousands of wintering cackling
  and Canada geese.  Bag limits and special hunts rely heavily on population estimates,
  especially for controversial species such as dusky Canada goose and cackling goose.
  \ Cackling geese undergo a subsistence hunt by native groups in Alaska.  This hunt
  occurs on the nesting grounds and factors into annual bag limits for hunters in
  the lower 48.  In addition, the wintering grounds of cacklers has shifted from the
  central valley of CA to the Willamette and Columbian River Valleys of OR and WA.
  \ This winter range now overlaps with the dusky Canada goose range, and duskies
  have undergone a dramatic decrease in population since the 1964 Good Friday earthquake
  that occurred near their breeding grounds.  Despite the low dusky population, geese
  in the Willamette Valley are numerous and cause a good deal of crop damage.These
  issues have brought attention to goose populations on refuges.  An intermixing of
  overpopulated and underpopulated subspecies has complicated harvest and management.
  \ To better manage the cackler population, a concerted effort to estimate the actual
  population has been undertaken by a variety of agencies.  Geese have been banded
  on nesting grounds agencies have been asked to participate in tracking their presence
  in wintering areas for a mark/recapture study.  The majority of this effort ended
  in 2013, but information is still being collected on collared birds.\",\n\t\"license_title\":
